// src/Layout.jsx

import React, { useState } from 'react';
import { Link, Navigate } from 'react-router-dom';

function Layout({ children }) {
  // Basit auth kontrolü: localStorage'da "token" var mı diye bak
  const token = localStorage.getItem('token');

  // Token yoksa login'e yönlendir
  if (!token) {
    return <Navigate to="/login" replace />;
  }

  // Eklenecek: Network submenu görünür mü?
  const [showNetworkSubmenu, setShowNetworkSubmenu] = useState(false);

  const toggleNetworkSubmenu = () => {
    setShowNetworkSubmenu((prev) => !prev);
  };

  return (
    <div className="d-flex flex-column" style={{ minHeight: '100vh' }}>
      {/* Üst NavBar */}
      <nav className="navbar navbar-dark bg-dark" style={{ height: '80px' }}>
        <div className="container-fluid d-flex align-items-center justify-content-between h-100">
          {/* Sol taraf: Marka */}
          <div className="d-flex flex-column">
            <span className="navbar-brand fs-3 mb-0">NetGate</span>
            <span className="text-white fs-6" style={{ marginTop: '-3px' }}>
              Hoş Geldiniz, Sistem Yöneticisi
            </span>
          </div>

          {/* Sağ taraf: (Opsiyonel) kullanıcı menüsü / profil */}
        </div>
      </nav>

      {/* İçerik + Yan Menü alanı */}
      <div className="flex-grow-1">
        <div className="row g-0 h-100">
          {/* Yan Menü (Sabit Genişlik) */}
          <div
            className="col-auto bg-light"
            style={{ width: '220px', minHeight: 'calc(100vh - 80px)' }}
          >
            <div className="p-3">
              <h6 className="mb-3 text-uppercase text-secondary">Menü</h6>
              <ul className="nav flex-column">

                {/* Ana Sayfa */}
                <li className="nav-item mb-1">
                  <Link className="nav-link" to="/">
                    Ana Sayfa
                  </Link>
                </li>

                {/* Log Yönetimi */}
                <li className="nav-item mb-1">
                  <Link className="nav-link" to="/logs">
                    Log Yönetimi
                  </Link>
                </li>

                {/* Güncellemeler */}
                <li className="nav-item mb-1">
                  <Link className="nav-link" to="/updates">
                    Güncellemeler
                  </Link>
                </li>

                {/* Güvenlik Kuralları */}
                <li className="nav-item mb-1">
                  <Link className="nav-link" to="/rules">
                    Güvenlik Kuralları
                  </Link>
                </li>

                {/* Raporlar */}
                <li className="nav-item mb-1">
                  <Link className="nav-link" to="/reports">
                    Raporlar
                  </Link>
                </li>

                {/* Sistem Ayarları */}
                <li className="nav-item mb-1">
                  <Link className="nav-link" to="/settings">
                    Sistem Ayarları
                  </Link>
                </li>

                {/* ---- Örneğin "Network" menüsü, alt menü ile ---- */}
                <li className="nav-item mb-1">
                  {/*
                    Burada Link yerine sadece <div> da kullanılabilir,
                    ama isterseniz 'Network' e tıklandığında alt menü açılsın:
                  */}
                  <div
                    className="nav-link d-flex justify-content-between align-items-center"
                    style={{ cursor: 'pointer' }}
                    onClick={toggleNetworkSubmenu}
                  >
                    <span>Network</span>
                    <span>
                      {showNetworkSubmenu ? '▼' : '▶'}
                      {/* Basit bir arrow ikon */}
                    </span>
                  </div>

                  {/* Alt menü */}
                  {showNetworkSubmenu && (
                    <ul className="nav flex-column ms-3 mt-1">
                      <li className="nav-item mb-1">
                        <Link className="nav-link" to="/network">
                          Interfaces
                        </Link>
                      </li>
                      {/* Burada ileride NAT vs. ekleyebilirsiniz */}
                      {/*
                      <li className="nav-item mb-1">
                        <Link className="nav-link" to="/network/nat">
                          NAT Ayarları
                        </Link>
                      </li>
                      */}
                    </ul>
                  )}
                </li>

              </ul>
            </div>
          </div>

          {/* Sağdaki Asıl İçerik */}
          <div className="col p-4">
            {children}
          </div>
        </div>
      </div>
    </div>
  );
}

export default Layout;
